You can set which versions of Hindenburg that your plugin is compatible with in your plugin's `package.json`:

```json
{
    "engines": {
        "node": ">=14",
        "hindenburg": "1.1.*"
    }
}
```

> Note that this is _not_ the same syntax used in the `"node"` entry above. Instead, it will accept a [glob pattern](https://en.wikipedia.org/wiki/Glob_(programming)).

This allows you to specify exactly which versions of Hindenburg will work with your plugin.

By default, if you're using the {@page Creating a Plugin | template creator} script, this will be set to whichever version of Hindenburg you're currently running with the last segment (the [patch](https://semver.org/) version) replaced with a wildcard `*`. This runs under the assumption that Hindenburg's API should remainly relatively stable throughout each patch, whereas it might change more drastically between each minor update.

## Specific Versions
If you know _exactly_ which versions of Hindenburg your plugin supports, you can get creative with the glob pattern:

```json
{
    "engines": {
        "node": ">=14",
        "hindenburg": "1.@(1|2).*"
    }
}
```

> Check out this [extended glob syntax guide](https://www.linuxjournal.com/content/bash-extended-globbing) for more information on how to write a glob pattern.

## All Versions
If you wish to accept _all_ versions of Hindenburg, or you're lazy at maintaining your plugins, then you can either remove `"hindenburg"` from the `engines` object, or, replace the version with a wildcard `*`:

```json
{
    "engines": {
        "node": ">=14",
        "hindenburg": "*"
    }
}
```

## Global Plugins
Global plugins in Hindenburg are those that are attached to the worker, allowing you to listen for events regarding connections and any features that transcend individual rooms, as well as listen for events emitted from all rooms.

You can create a global plugin by extending the {@link WorkerPlugin} class exported by `@skeldjs/hindenburg`, for example:
```ts
@HindenburgPlugin("hbplugin-fun-things", "1.0.0", "none")
export class MyPlugin extends WorkerPlugin {
    constructor(
        public readonly worker: Worker,
        public readonly config: any
    ) {
        super(worker, config);
    }
}
```

Notice how worker plugins accept a {@link Worker} object as a parameter to their constructor, while room plugins accept a {@link Room} object.

There also are some things that worker plugins allow you to do that room plugins do not, such as creating [custom CLI commands](./CLI%20Commands) and listening and registering [custom protocol messages](./Protocol%20Messages).

Also, any events, chat commands or reactor rpc handlers created on global/worker plugins will be applied to _every room created_ after the plugin is loaded, and will remain after the plugin has been unloaded, although they will no longer be applied to any new rooms.

## Room Plugins
Room plugins are plugins that are loaded on specific rooms, being properly scoped and only recieving data from the rooms that they're scoped to.

The use of room plugins can be very powerful, for instance you could mix and match gamemodes or features for specific rooms.

Room plugins can be created by extending the {@link RoomPlugin} class exported by Hindenburg, for example:
```ts
@HindenburgPlugin("hbplugin-fun-things", "1.0.0", "none")
export class MyPlugin extends RoomPlugin {
    constructor(
        public readonly room: Room,
        public readonly config: any
    ) {
        super(room, config);
    }
}
```

This time, the constructor accepts a {@link Room} object as its first parameter.

Room plugins are instantiated for each room, meaning you can store data on the plugin, ensured that it won't be used by multiple plugins at once.

One of the most central components to writing a plugin for Hindenburg is the ability to listen for specific events from rooms or from the worker.

## Attaching Listeners
As with every other Hindenburg plugin design decisions; you can attach event listeners with the {@link EventListener | `@EventListener`} decorator.

For example:
```ts
@HindenburgPlugin("hbplugin-fun-things", "1.0.0", "none")
export class MyPlugin extends RoomPlugin {
    @EventListener("player.setcolor")
    onPlayerSetColor(ev: PlayerSetColorEvent<Room>) {
        this.logger.info("Player %s set their color to %s",
            ev.player, Color[ev.newColor]);
    }
}
```

> You can access every symbol, `EventListener`, `PlayerSetColorEvent` and `Color` via the `@skeldjs/hindenburg` package.

Many (not all) events will allow you to cancel what would normally happen, or allow you to revert any changes that the event made. Most events also allow you to change data, for example the [`room.assignroles`](https://skeld.js.org/classes/core.RoomAssignRolesEvent.html) event allows you to modify the roles that will be assigned to players when the game starts.

Some events will also wait for any asynchronous tasks to complete.

> Be careful what you do in certain events. The [`room.fixedupdate`](https://skeld.js.org/classes/core.RoomFixedUpdateEvent.html) event, for example, can significantly slow down your server if handlers for this event take too long.

If you're writing a room plugin, only events emitted from _that_ room will be listened to. Events attached to rooms or to the worker will be detached if your plugin is unloaded.

## TypeScript
If you're working in TypeScript, due to a [long-standing issue](https://github.com/Microsoft/TypeScript/issues/4881), you must specify the type of the event, making it slightly more verbose, i.e. `ev: PlayerSendChatEvent<Room>`.

However, Hindenburg allows you to use this to your advantage, as you can omit the event name entirely from the `@EventListener()` decorator, thanks to TypeScript's ability to emit type metadata for decorators. For example, you could instead do:
```ts
@EventListener()
onPlayerSetColor(ev: PlayerSetColorEvent<Room>) {
    this.logger.info("Player %s set their color to %s",
        ev.player, Color[ev.newColor]);
}
```

## Events to Listen for
As Hindenburg is based upon [skeldjs](https://skeld.js.org), it naturally inherits every event, which you can [view here](https://skeld.js.org/pages/Information/Events.html#event-list).

Hindenburg also adds a few more events, and modifies some skeldjs ones:

### Clients
* {@link ClientBanEvent | `client.ban`}
* {@link ClientBroadcastEvent | `client.broadcast`}
* {@link ClientConnectEvent | `client.connect`}

### Rooms
* {@link ClientConnectEvent | `room.beforecreate`}
* {@link ClientConnectEvent | `room.beforedestroy`}
* {@link ClientConnectEvent | `room.create`}
* {@link ClientConnectEvent | `room.destroy`}
* {@link ClientConnectEvent | `room.gameend`}
* {@link ClientConnectEvent |  `room.gamestart`}
* {@link ClientConnectEvent | `room.selecthost`}

### Worker
* {@link WorkerBeforeJoinEvent | `worker.beforejoin`}
* {@link WorkerGetGameListEvent | `worker.getgamelist`}
* {@link WorkerImportPluginEvent | `worker.importplugin`}
* {@link WorkerLoadPluginEvent | `worker.loadplugin`}

A great and easy way to allow players to communicate with your plugin is through the use of [Chat Commands](../Information/Chat%20Commands.html).

Hindenburg provides a simple, quick way to register your own custom chat commands in your plugins.

Similar to most things in Hindenburg, there's a special {@link ChatCommand | `@ChatCommand`} decorator you can use, for example:
```ts
@ChatCommand("add <first> <second>", "Add two numbers together")
onAddCommand(ctx: ChatCommandContext, args: any) {
    const first = parseFloat(args.first);
    const second = parseFloat(args.second);

    if (isNaN(first) || isNaN(second))
        return ctx.reply("Expected a number for 'first' and 'second'");

    const result = first + second;
    ctx.reply(first + " + " + second + " = " + result);
}
```

![image](https://user-images.githubusercontent.com/60631511/143774107-36468587-b1a6-4523-bca7-17cd07c77a52.png)

![image](https://user-images.githubusercontent.com/60631511/143774137-a97f8a30-8635-4b56-a425-b11e382c6266.png)

## The Decorator
The first argument you can pass into the decorator describes the syntax of the command. The word before the first space is the name of the command, or the trigger. Anything after the first word act as parameters that players can pass into the command, parameters surrounded by `<>` means that the parameter is _required_, and parameters surrounded by `[]` means that the parameter is _optional_.

If the last argument name ends with `...` it will select the remaining text that the player passed in. (The `...` doesn't count towards the argument name).


For example:
`setname <name...>` would select anything from:
* `/setname jesus christ` - where `{ name: "jesus christ" }`
* `/setname the 1975` - where `{ name: "the 1975" }`

But wouldn't accept:
* `/setname`

This is similar to the [Command Description Syntax](https://en.wikipedia.org/wiki/Command-line_interface#Command_description_syntax) for CLI commands.

The second argument is a short, one-sentence summary of the command.

## Method Body
The body of the decorator, or the method that it's attached to, is called when someone uses the command in question.

The {@link ChatCommandContext | `ctx`} argument allows you to reply to the message as the server, acting simply as a wrapper for {@link Room.sendChat}. It also provides information about the player that sent the message calling the command, and the room that it came from.

The `args` argument is an object containing any arguments that the player passed into the command, mapped by the parameter name as described in [the decorator](#the-decorator). The arguments will _always_ be strings, so you must parse it yourself.

> Note that the parameter name doesn't include the surrounding `<>`s or `[]`s, or the `...` if it exists.

## Restrict Command to Certain Players
You can restrict how your command is accessed/shows up in the `/help` command listing through the use of short, simple **access check** functions. This is as simple as passing in a function that takes in a player that is trying to execute the command and returns a boolean (`true`/`false`),

### Example
```ts
@ChatCommand("addhost <player name...>", "Add a host to the room.", player => player.isHost)
onChat(ctx: ChatCommandContext, args: any) {
    const playerName = args["player name"];

    if (!playerName)
        return ctx.reply("Who should I make host?");

    const [ player ] = ctx.room.findPlayersWithName(args["player name"]);

    if (!player || !player.playerInfo)
        return ctx.reply("No player has a name of '" + args["player name"] + "'");

    ctx.room.addActingHost(player);
    ctx.reply("%s is now a host", player.playerInfo.defaultOutfit.name);
}
```

Notice the new function passed into `@ChatCommand`: `player => player.isHost`. This will make the command only available to host players.

Here are some more functions to filter which players can use your commands:
- `player => player.playerInfo?.isImpostor` - Only available to impostors
- `player => player.playerInfo?.isDead` - Only available to dead playerss
- `player => !player.playerInfo?.isDead` - Only available to alive players
- `player => !!player.room.meetingHud` - Only available during meetings
- `player => !!player.room.lobbyBehaviour` - Only available during the lobby (before games)

Adding a filter to your command will also change how the help command shows up for each player:
![image](https://user-images.githubusercontent.com/60631511/171652565-257d0c49-c90e-48c9-91f8-3a967d06cc6f.png)
_The player on the left screen is the host of the room_

Any player that attempts to use a command that isn't available to them, will be met with a notice that the command doesn't exist.

## Notes
Note that Hindenburg does not support typical CLI features such as flags (`-p`) or switches (`/p`) or options (`--port`). This is entirely to keep chat commands as simple as possible.

There are a few lifecycle methods that you can override in your plugins to listen for specific events.

> If you're looking to listen for game and worker events, check out the {@page Event Listeners} guide.

## Constructor
Depending on whether you're writing a {@page Worker and Room Plugins | worker or a room} plugin, the constructor may be different to override.


For example, a worker plugin constructor:
```ts
constructor(
    public readonly worker: Worker,
    public config: any
) {
    super(worker, config);
}
```

vs a room plugin:
```ts
constructor(
    public readonly room: Room,
    public config: any
) {
    super(room, config);
}
```

The constructor lets you assign any properties on your plugin that TypeScript or JavaScript will shout at you for being unassigned. Being non-asynchronous, you should not use it for any tasks with callbacks or that return a [Promise](https://developer.mozilla.org/en-US/docs/Web/JavaScript/Reference/Global_Objects/Promise). Instead, use the [`onPluginLoad`](#onpluginload).

## Methods
### `onPluginLoad()`
Very simply, this method is called when your plugin is first loaded and all events, commands and messages have been attached.

```ts
@HindenburgPlugin("hbplugin-fun-things", "1.0.0", "none")
export class MyPlugin extends WorkerPlugin {
    async onPluginLoad() {

    }
}
```

Hindenburg will wait for this method to finish if it's marked as asynchronous, so it's useful for connecting to servers or fetching resources before the server starts.

### `onPluginUnload()`
Also rather simply, this method is called when your plugin is about to be unloaded, although has not yet actually been unloaded from the server. Hindenburg will not wait for this to complete, but any asynchronous tasks can still run parallel.

```ts
@HindenburgPlugin("hbplugin-fun-things", "1.0.0", "none")
export class MyPlugin extends WorkerPlugin {
    onPluginUnload() {

    }
}
```

### `onConfigUpdate(oldConfig: any, newConfig: any)`
Called when your plugin's config in the server's `config.json` is modified, it allows you to catch when your plugin's config updates.

Useful for verifying the config, or modifying your plugin based on the new configuration.

```ts
@HindenburgPlugin("hbplugin-fun-things", "1.0.0", "none")
export class MyPlugin extends WorkerPlugin {
    onConfigUpdate(oldConfig: any, newConfig: any) {

    }
}
```
